import styled from 'styled-components';

const Input = styled.input`
	width: 100%;
  max-width: 100%;
  padding: 5px 10px;
  color: #363636;
  font-size: 1rem;
  border: 1px solid #dbdbdb;
  box-shadow: inset 0 1px 2px rgba(10,10,10,.1);
`;

export default Input;
